mationText\" name=\"\" data-field-type=\"TEXTAREA\" data-field-completion-action=\"NONE\">Exam Date:  Exam Type: MRI Cervical Spine Name of Patient:  Date of Birth: </textarea>\n            </p>\n        </section>\n        <section id=\"comparisons\" class=\"level1\" data-section-name=\"Comparison\">\n            <header class=\"level1\">\n                Comparison\n            </header>\n            <p title=\"\">\n                <label for=\"comparisonsText\"></label>\n                <textarea rows=\"3\" cols=\"100\" id=\"comparisonsText\" name=\"\" data-field-type=\"TEXTAREA\" data-field-completion-action=\"NONE\"></textarea>\n            </p>\n        </section>\n        <section id=\"findings\" class=\"level1\" data-section-name=\"Findings\">\n            <header class=\"level1\">\n                Findings\n            </header>\n            <p title=\"\">\n                <label for=\"findingsText\"></label>\n                <textarea rows=\"3\" cols=\"100\" id=\"findingsText\" name=\"\" data-field-type=\"TEXTAREA\" data-field-completion-action=\"NONE\">Bone marrow signal intensity is normal. No evidence for fracture. Vertebral bodies are normally aligned. Vertebral body heights are preserved. Normal cord signal without evidence of syringomyelia. The cranio-vertebral junction appears normal. Visualized soft tissues of the cervical neck appear normal. Level-by-level degenerative findings as follows:  C2-C3: No significant spinal canal stenosis or neural foraminal narrowing.   [Mild / Mod / Severe] Disc desiccation with diffuse [Disc / Annular] bulge and focal [Anterior / Posterior (Central / Paracentral / Foraminal /Extraforaminal)] disc [Protrusion / Extrusion]. Associated end-plate changes include [Modic I, II, III changes / End-plate irregularity / Spondylosis (osteophytes) / Degenerative instability (vertebral body height loss / Listhesis (Type I (above or below degen level) / Type II (at degen level)]. These findings result in [Mild / Mod / Severe] spinal canal stenosis and [Mild / Mod / Severe] [Right/Left] neural foraminal narrowing.  C3-C4: No significant spinal canal stenosis or neural foraminal narrowing.  C4-C5: No significant spinal canal stenosis or neural foraminal narrowing.  C5-C6: No significant spinal canal stenosis or neural foraminal narrowing.  C6-C7: No significant spinal canal stenosis or neural foraminal narrowing.  C7-T1: No significant spinal canal stenosis or neural foraminal narrowing.</textarea>\n            </p>\n        </section>\n        <section id=\"impression\" class=\"level1\" data-section-name=\"Impression\">\n            <header class=\"level1\">\n                Impression\n            </header>\n            <p title=\"\">\n                <label for=\"impressionText\"></label>\n                <textarea rows=\"3\" cols=\"100\" id=\"impressionText\" name=\"\" data-field-type=\"TEXTAREA\" data-field-completion-action=\"NONE\"></textarea>\n            </p>\n        </section>\n    </body>\n</html>','2025-09-05 09:09:58','2025-09-05 09:19:34'),(2,'50866','85de14d9-731d-11ec-aa63-0a9d700ab598','CTA Heart Fractional Flow Reserve','English','2022-01-11 15:01:57','Cardiac Radiology,Computed Tomography','CA,CT',NULL,5616,'CTA Heart Fractional Flow Reserve - Cardiac Radiology,Computed Tomography template with structured reporting format.','Dr. Michael Chen','Amanda','Johnson',0,'html','<!DOCTYPE html>\n<html>\n    <head>\n        <title>CTA Heart Fractional Flow Reserve</title>\n        <meta charset=\"UTF-8\" />\n        <meta name=\"dcterms.identifier\" content=\"42e86053-63ef-45ce-8eca-600a192f2ef8\" />\n        <meta name=\"dcterms.title\" content=\"CTA Heart Fractional Flow Reserve\" />\n        <meta name=\"dcterms.description\" content=\"CTA Heart Fractional Flow Reserve\" />\n        <meta name=\"dcterms.type\" content=\"IMAGE_REPORT_TEMPLATE\" />\n        <meta name=\"dcterms.language\" content=\"en\" />\n        <meta name=\"dcterms.publisher\" content=\"RSNA\" />\n        <met